import React from 'react';

import { 
  Container,
  HeaderChat,
  InputChat,
  IconHashtag,
  IconNotification,
  IconPin,
  IconGroup,
  IconAtSign,
  MessagesChat,
} from './styles';

const Chat: React.FC = () => {
  return (
    <Container>
      <HeaderChat>
        <IconHashtag />
        <h1>general</h1>
        <IconNotification />
        <IconPin />
        <IconGroup />
        <IconAtSign />
      </HeaderChat>
      <MessagesChat />
      <InputChat />
    </Container>
  );
}

export default Chat;
